import React, { Component } from 'react';
import './style.css';
class TodoList extends Component {
  render() {
    return (
      <div>
        <ul>
        {this.props.todos.map(todo => <li className={todo.done? 'done' : null} key={todo.text}>{todo.text}</li>)}
        </ul>
      </div>
    );
  }
}

export default TodoList;
